import React from 'react';

const Experience: React.FC = () => {
    const experiences = [
        {
            title: "Senior Full Stack Developer",
            company: "Tech Solutions Inc.",
            period: "2023 - Present",
            description: [
                "Led development of multiple web applications using React, Node.js, and MongoDB",
                "Mentored junior developers and conducted code reviews",
                "Implemented CI/CD pipelines and improved deployment processes",
                "Collaborated with cross-functional teams to deliver high-quality products"
            ],
            technologies: ["React", "Node.js", "MongoDB", "AWS", "Docker"]
        },
        {
            title: "Full Stack Developer",
            company: "Digital Innovations Ltd.",
            period: "2022 - 2023",
            description: [
                "Developed and maintained client websites and web applications",
                "Worked with REST APIs and third-party integrations",
                "Optimized application performance and user experience",
                "Participated in agile development processes"
            ],
            technologies: ["JavaScript", "React", "Express.js", "PostgreSQL", "Git"]
        },
        {
            title: "Frontend Developer Intern",
            company: "StartupXYZ",
            period: "2021 - 2022",
            description: [
                "Built responsive user interfaces using React and TypeScript",
                "Collaborated with designers to implement UI/UX designs",
                "Learned modern development practices and tools",
                "Contributed to open-source projects"
            ],
            technologies: ["React", "TypeScript", "CSS3", "Git", "Figma"]
        }
    ];

    return (
        <section id="experience" className="experience">
            <div className="container">
                <h2 className="section-title">Work Experience</h2>
                <div className="experience-timeline">
                    {experiences.map((exp, index) => (
                        <div key={index} className="experience-item">
                            <div className="experience-header">
                                <h3>{exp.title}</h3>
                                <div className="experience-meta">
                                    <span className="company">{exp.company}</span>
                                    <span className="period">{exp.period}</span>
                                </div>
                            </div>
                            <div className="experience-content">
                                <ul>
                                    {exp.description.map((item, itemIndex) => (
                                        <li key={itemIndex}>{item}</li>
                                    ))}
                                </ul>
                                <div className="experience-technologies">
                                    {exp.technologies.map((tech, techIndex) => (
                                        <span key={techIndex} className="tech-tag">{tech}</span>
                                    ))}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Experience;
